import { Routes } from 'react-router-dom';
import './App.css';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Home from './Components/HomeComponent/Home';

function App() {
  return (
   <>
    <div className="App">
    <BrowserRouter>
      <Routes>
        {/* Define your routes here */}
        {/* For example */}
        <Route path="/home" component={Home} />
        {/* Define other routes */}
      </Routes>
    </BrowserRouter>

    </div>
   </>
  );
}

export default App;
